"<div>\n<i class=\"NoteType\">\nNote sur la source\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLe LAFRANCE - Mise \u00e0 jour Octobre 2016\n</p>\n<p>\nL'Am\u00e9rique fran\u00e7aise : registres anciens et nouveaux et ses collections effectives\n</p>\n<p>\nCouvre toute la p\u00e9riode 1621-1849 du Qu\u00e9bec catholique et les actes de mariage catholiques du Qu\u00e9bec 1825-1915. Comprend plusieurs actes BS pour la p\u00e9riode 1850-1861 et certains jusqu'en 2008.<br />\n3 421 559 actes NBMDS.<br />\nLien \u00e0 l'image de l'acte du Fonds Drouin.\n</p>\n</div>\n</div>",
