"<div>\n<i class=\"NoteType\">\nNote sur la source\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThis collection contains muster roll abstracts of New York State Infantry units that served in the Civil War. The records are from microfilm found at the New York State Archives and contain 550,000 records spanning 395 volumes. The beginning of the regiment record includes information on the regiment and may contain a detailed history of the unit. The individual records may contain name, date of enlistment, age, place of enlistment, grade, company, regiment, reason for leaving, promotions, participation in engagements, wounds, and physical appearance.\n</p>\n</div>\n</div>",
